import React from "react";

function Home() {
  return (
    <div className = "homepage">
      <div className="intro">
        <h1 className = "">Pierce Butler</h1>
        <h1>Software Engineer</h1>
        <h1>Front-end Enthusiast</h1>
      </div>
      <div className="links">
        <h1>About Me</h1>
        <h1>Portfolio</h1>
        <h1>Contact me</h1>
      </div>
    </div>
  );
}

export default Home;
